import { Link } from 'react-router-dom'

function Module(props)  {

  return  (
    <div className="loginPage">
      <Link to={props.link} className="loginPage__headerButton">{props.headerButton}</Link>
      <form className="loginPage__form">
        <h2 className="loginPage__title">{props.name}</h2>
        <input className="loginPage__input" placeholder="Email"
        onChange={props.passChange}
        valuePass={name || ""}
         ></input>
        <input className="loginPage__input" placeholder="Пароль"></input>
        <button className="loginPage__submitButton">{props.submitButton}</button>
      </form>
      {props.children}
    </div>
  )
}

export default Module;
